    d_field_dcos_dns_record_type(Rest, N + 7,
				    X bsl N + Acc, F1, F2, F3, F4);
d_field_dcos_dns_record_type(<<0:1, X:7,
				  Rest/binary>>,
				N, Acc, F1, _, F3, F4) ->
    <<Tmp:32/signed-native>> = <<(X bsl N +
				    Acc):32/unsigned-native>>,
    NewFValue = 'd_enum_Record.Type'(Tmp),
    dfp_read_field_def_dcos_dns_record(Rest, 0, 0, F1,
					  NewFValue, F3, F4).


d_field_dcos_dns_record_srv_record(<<1:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, F3, F4)
    when N < 57 ->
    d_field_dcos_dns_record_srv_record(Rest, N + 7,
					  X bsl N + Acc, F1, F2, F3, F4);
d_field_dcos_dns_record_srv_record(<<0:1, X:7,
					Rest/binary>>,
				      N, Acc, F1, F2, F3, F4) ->
    Len = X bsl N + Acc,
    <<Bs:Len/binary, Rest2/binary>> = Rest,
    NewFValue = decode_msg(Bs, dcos_dns_srvrecord),
    dfp_read_field_def_dcos_dns_record(Rest2, 0, 0, F1,
					  F2,
					  if F3 == undefined -> NewFValue;
					     true ->
						 merge_msg_dcos_dns_srvrecord(F3,
										 NewFValue)
					  end,
					  F4).


d_field_dcos_dns_record_a_record(<<1:1, X:7,
				      Rest/binary>>,
				    N, Acc, F1, F2, F3, F4)
    when N < 57 ->
    d_field_dcos_dns_record_a_record(Rest, N + 7,
					X bsl N + Acc, F1, F2, F3, F4);
d_field_dcos_dns_record_a_record(<<0:1, X:7,
				      Rest/binary>>,
				    N, Acc, F1, F2, F3, F4) ->
    Len = X bsl N + Acc,
    <<Bs:Len/binary, Rest2/binary>> = Rest,
    NewFValue = decode_msg(Bs, dcos_dns_arecord),
    dfp_read_field_def_dcos_dns_record(Rest2, 0, 0, F1,
					  F2, F3,
					  if F4 == undefined -> NewFValue;
					     true ->
						 merge_msg_dcos_dns_arecord(F4,
									       NewFValue)
					  end).


