d_msg_dcos_dns_zone(Bin) ->
    dfp_read_field_def_dcos_dns_zone(Bin, 0, 0,
					undefined, []).

dfp_read_field_def_dcos_dns_zone(<<10, Rest/binary>>,
				    Z1, Z2, F1, F2) ->
    d_field_dcos_dns_zone_name(Rest, Z1, Z2, F1, F2);
dfp_read_field_def_dcos_dns_zone(<<18, Rest/binary>>,
				    Z1, Z2, F1, F2) ->
    d_field_dcos_dns_zone_records(Rest, Z1, Z2, F1, F2);
dfp_read_field_def_dcos_dns_zone(<<>>, 0, 0, F1,
				    F2) ->
    #dcos_dns_zone{name = F1,
		      records = lists:reverse(F2)};
dfp_read_field_def_dcos_dns_zone(Other, Z1, Z2, F1,
				    F2) ->
    dg_read_field_def_dcos_dns_zone(Other, Z1, Z2, F1,
				       F2).

dg_read_field_def_dcos_dns_zone(<<1:1, X:7,
				     Rest/binary>>,
				   N, Acc, F1, F2)
    when N < 32 - 7 ->
    dg_read_field_def_dcos_dns_zone(Rest, N + 7,
				       X bsl N + Acc, F1, F2);
dg_read_field_def_dcos_dns_zone(<<0:1, X:7,
				     Rest/binary>>,
				   N, Acc, F1, F2) ->
    Key = X bsl N + Acc,
    case Key of
      10 -> d_field_dcos_dns_zone_name(Rest, 0, 0, F1, F2);
      18 ->
	  d_field_dcos_dns_zone_records(Rest, 0, 0, F1, F2);
      _ ->
	  case Key band 7 of
	    0 -> skip_varint_dcos_dns_zone(Rest, 0, 0, F1, F2);
	    1 -> skip_64_dcos_dns_zone(Rest, 0, 0, F1, F2);
	    2 ->
		skip_length_delimited_dcos_dns_zone(Rest, 0, 0, F1,
						       F2);
	    5 -> skip_32_dcos_dns_zone(Rest, 0, 0, F1, F2)
	  end
    end;
dg_read_field_def_dcos_dns_zone(<<>>, 0, 0, F1,
				   F2) ->
    #dcos_dns_zone{name = F1,
		      records = lists:reverse(F2)}.

d_field_dcos_dns_zone_name(<<1:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2)
    when N < 57 ->
    d_field_dcos_dns_zone_name(Rest, N + 7,
				  X bsl N + Acc, F1, F2);
d_field_dcos_dns_zone_name(<<0:1, X:7, Rest/binary>>,
			      N, Acc, _, F2) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_dcos_dns_zone(Rest2, 0, 0,
					NewFValue, F2).


d_field_dcos_dns_zone_records(<<1:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, F2)
    when N < 57 ->
    d_field_dcos_dns_zone_records(Rest, N + 7,
