d_field_dcos_dns_zone_records(<<0:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, F2) ->
    Len = X bsl N + Acc,
    <<Bs:Len/binary, Rest2/binary>> = Rest,
    NewFValue = decode_msg(Bs, dcos_dns_record),
    dfp_read_field_def_dcos_dns_zone(Rest2, 0, 0, F1,
					[NewFValue | F2]).


skip_varint_dcos_dns_zone(<<1:1, _:7, Rest/binary>>,
			     Z1, Z2, F1, F2) ->
    skip_varint_dcos_dns_zone(Rest, Z1, Z2, F1, F2);
skip_varint_dcos_dns_zone(<<0:1, _:7, Rest/binary>>,
			     Z1, Z2, F1, F2) ->
