skip_length_delimited_dcos_dns_zone(<<1:1, X:7,
					 Rest/binary>>,
				       N, Acc, F1, F2)
    when N < 57 ->
    skip_length_delimited_dcos_dns_zone(Rest, N + 7,
					   X bsl N + Acc, F1, F2);
skip_length_delimited_dcos_dns_zone(<<0:1, X:7,
					 Rest/binary>>,
				       N, Acc, F1, F2) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_dcos_dns_zone(Rest2, 0, 0, F1,
					F2).


skip_32_dcos_dns_zone(<<_:32, Rest/binary>>, Z1, Z2,
			 F1, F2) ->
    dfp_read_field_def_dcos_dns_zone(Rest, Z1, Z2, F1,
					F2).


skip_64_dcos_dns_zone(<<_:64, Rest/binary>>, Z1, Z2,
			 F1, F2) ->
    dfp_read_field_def_dcos_dns_zone(Rest, Z1, Z2, F1,
					F2).




merge_msgs(Prev, New)
    when element(1, Prev) =:= element(1, New) ->
    case Prev of
      #dcos_dns_arecord{} ->
	  merge_msg_dcos_dns_arecord(Prev, New);
      #dcos_dns_srvrecord{} ->
	  merge_msg_dcos_dns_srvrecord(Prev, New);
      #dcos_dns_record{} ->
	  merge_msg_dcos_dns_record(Prev, New);
      #dcos_dns_zone{} ->
	  merge_msg_dcos_dns_zone(Prev, New)
    end.

merge_msg_dcos_dns_arecord(Prev, undefined) -> Prev;
merge_msg_dcos_dns_arecord(undefined, New) -> New;
merge_msg_dcos_dns_arecord(#dcos_dns_arecord{ip =
						       PFip},
			      #dcos_dns_arecord{ip = NFip}) ->
    #dcos_dns_arecord{ip =
			     if NFip =:= undefined -> PFip;
				true -> NFip
			     end}.

merge_msg_dcos_dns_srvrecord(Prev, undefined) ->
    Prev;
merge_msg_dcos_dns_srvrecord(undefined, New) -> New;
merge_msg_dcos_dns_srvrecord(#dcos_dns_srvrecord{priority
							   = PFpriority,
						       weight = PFweight,
						       target = PFtarget,
						       port = PFport},
				#dcos_dns_srvrecord{priority = NFpriority,
						       weight = NFweight,
						       target = NFtarget,
						       port = NFport}) ->
    #dcos_dns_srvrecord{priority =
			       if NFpriority =:= undefined -> PFpriority;
				  true -> NFpriority
			       end,
			   weight =
			       if NFweight =:= undefined -> PFweight;
				  true -> NFweight
			       end,
			   target =
			       if NFtarget =:= undefined -> PFtarget;
				  true -> NFtarget
			       end,
			   port =
			       if NFport =:= undefined -> PFport;
				  true -> NFport
			       end}.

merge_msg_dcos_dns_record(#dcos_dns_record{name =
						     PFname,
						 type = PFtype,
						 srv_record = PFsrv_record,
						 a_record = PFa_record},
			     #dcos_dns_record{name = NFname, type = NFtype,
						 srv_record = NFsrv_record,
						 a_record = NFa_record}) ->
    #dcos_dns_record{name =
			    if NFname =:= undefined -> PFname;
			       true -> NFname
			    end,
			type =
			    if NFtype =:= undefined -> PFtype;
			       true -> NFtype
			    end,
			srv_record =
			    merge_msg_dcos_dns_srvrecord(PFsrv_record,
							    NFsrv_record),
			a_record =
			    merge_msg_dcos_dns_arecord(PFa_record,
							  NFa_record)}.

merge_msg_dcos_dns_zone(#dcos_dns_zone{name =
						 PFname,
					     records = PFrecords},
			   #dcos_dns_zone{name = NFname,
					     records = NFrecords}) ->
    #dcos_dns_zone{name =
			  if NFname =:= undefined -> PFname;
			     true -> NFname
			  end,
		      records = PFrecords ++ NFrecords}.



verify_msg(Msg) ->
    case Msg of
      #dcos_dns_arecord{} ->
	  v_msg_dcos_dns_arecord(Msg, [dcos_dns_arecord]);
      #dcos_dns_srvrecord{} ->
	  v_msg_dcos_dns_srvrecord(Msg,
				      [dcos_dns_srvrecord]);
      #dcos_dns_record{} ->
	  v_msg_dcos_dns_record(Msg, [dcos_dns_record]);
      #dcos_dns_zone{} ->
	  v_msg_dcos_dns_zone(Msg, [dcos_dns_zone]);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


v_msg_dcos_dns_arecord(#dcos_dns_arecord{ip = F1},
			  Path) ->
    v_type_uint32(F1, [ip | Path]), ok;
v_msg_dcos_dns_arecord(X, Path) ->
    mk_type_error({expected_msg, dcos_dns_arecord}, X,
		  Path).

v_msg_dcos_dns_srvrecord(#dcos_dns_srvrecord{priority
						       = F1,
						   weight = F2, target = F3,
						   port = F4},
			    Path) ->
    v_type_int32(F1, [priority | Path]),
    v_type_int32(F2, [weight | Path]),
    v_type_string(F3, [target | Path]),
    v_type_int32(F4, [port | Path]),
    ok;
v_msg_dcos_dns_srvrecord(X, Path) ->
    mk_type_error({expected_msg, dcos_dns_srvrecord}, X,
		  Path).

v_msg_dcos_dns_record(#dcos_dns_record{name = F1,
					     type = F2, srv_record = F3,
					     a_record = F4},
			 Path) ->
    v_type_string(F1, [name | Path]),
    'v_enum_Record.Type'(F2, [type | Path]),
    if F3 == undefined -> ok;
       true ->
	   v_msg_dcos_dns_srvrecord(F3, [srv_record | Path])
    end,
    if F4 == undefined -> ok;
       true -> v_msg_dcos_dns_arecord(F4, [a_record | Path])
    end,
    ok;
v_msg_dcos_dns_record(X, Path) ->
    mk_type_error({expected_msg, dcos_dns_record}, X,
		  Path).

v_msg_dcos_dns_zone(#dcos_dns_zone{name = F1,
					 records = F2},
		       Path) ->
    v_type_string(F1, [name | Path]),
    if is_list(F2) ->
	   [v_msg_dcos_dns_record(Elem, [records | Path])
	    || Elem <- F2];
       true ->
	   mk_type_error({invalid_list_of,
			  {msg, dcos_dns_record}},
			 F2, Path)
    end,
    ok.

'v_enum_Record.Type'('A', _Path) -> ok;
'v_enum_Record.Type'('SRV', _Path) -> ok;
'v_enum_Record.Type'(X, Path) ->
    mk_type_error({invalid_enum, 'Record.Type'}, X, Path).

v_type_int32(N, _Path)
    when -2147483648 =< N, N =< 2147483647 ->
    ok;
v_type_int32(N, Path) when is_integer(N) ->
    mk_type_error({value_out_of_range, int32, signed, 32},
		  N, Path);
v_type_int32(X, Path) ->
    mk_type_error({bad_integer, int32, signed, 32}, X,
		  Path).

v_type_uint32(N, _Path) when 0 =< N, N =< 4294967295 ->
    ok;
v_type_uint32(N, Path) when is_integer(N) ->
    mk_type_error({value_out_of_range, uint32, unsigned,
		   32},
		  N, Path);
v_type_uint32(X, Path) ->
    mk_type_error({bad_integer, uint32, unsigned, 32}, X,
		  Path).

v_type_string(S, Path) when is_list(S); is_binary(S) ->
    try unicode:characters_to_binary(S) of
      B when is_binary(B) -> ok;
      {error, _, _} ->
	  mk_type_error(bad_unicode_string, S, Path)
    catch
      error:badarg ->
	  mk_type_error(bad_unicode_string, S, Path)
    end;
v_type_string(X, Path) ->
    mk_type_error(bad_unicode_string, X, Path).

mk_type_error(Error, ValueSeen, Path) ->
    Path2 = prettify_path(Path),
    erlang:error({gpb_type_error,
		  {Error, [{value, ValueSeen}, {path, Path2}]}}).


prettify_path([]) -> top_level;
prettify_path(PathR) ->
    list_to_atom(string:join(lists:map(fun atom_to_list/1,
				       lists:reverse(PathR)),
			     ".")).



